BEGIN TRANSACTION;
DROP TABLE IF EXISTS "users";
CREATE TABLE users (
	id INTEGER NOT NULL, 
	username VARCHAR(50) NOT NULL, 
	email VARCHAR(100) NOT NULL, 
	senha_hash VARCHAR(128) NOT NULL, 
	pasta_id VARCHAR(255), 
	email_token VARCHAR(255), 
	new_email VARCHAR(100), profile_image VARCHAR(255) NULL DEFAULT 'default_profile.png', 
	PRIMARY KEY (id), 
	UNIQUE (username), 
	UNIQUE (email), 
	UNIQUE (email_token)
);
DROP TABLE IF EXISTS "usuarios";
CREATE TABLE usuarios (
	id INTEGER NOT NULL, 
	email VARCHAR(120) NOT NULL, 
	username VARCHAR(80) NOT NULL, 
	senha_hash VARCHAR(128) NOT NULL, 
	pasta_id VARCHAR(80) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (email), 
	UNIQUE (username)
);
COMMIT;
